import React from 'react';
import './BrowseTrailer.css';

function TrailerList(props){

      
    const style={
        backgroundImage:`url('https://image.tmdb.org/t/p${props.discover.poster_path}')`
    };
    return(
        
        <div className="browse-movies">
            <h3>Discover</h3>
            <div className="movie-picture" style={style}></div>
            <div className="movie-details"></div>
        </div>
    )
};

export default TrailerList;
